import React from "react";
import { MDBCarousel, MDBCarouselInner, MDBContainer } from
"mdbreact";
import data from '../assets/json/data.js';
import CItem from './CItem.js';

class Carousel extends React.Component {

    createTable() {

        var list = [];
        list.push(<CItem key={0} itemId={0} title={data[0].name} src={data[0].image} />);
        list.push(<CItem key={1} itemId={1} title={data[1].name} src={data[1].image} />);
        list.push(<CItem key={2} itemId={2} title={data[1].name} src={data[1].image} />);
        list.push(<CItem key={3} itemId={3} title={data[2].name} src={data[2].image} />);

        return list;
    }

    render() {
        return (
            <MDBContainer className="carousel">
              <h4 className="mt-5 mb-2">Popular MYtineraries</h4>
              <MDBCarousel activeItem={1} length={4} showControls={true} showIndicators={true} className="z-depth-1">
                <MDBCarouselInner>
                    {this.createTable()}
                </MDBCarouselInner>
              </MDBCarousel>
            </MDBContainer>
          );
    }   
}

export default Carousel;
